import ExpenseItem from "./components/ExpenseItem";

function App() {
    const expenses = [
        {tile: 'Title1', amount: '100', date: new Date(2021, 2,1)},
        {tile: 'Title2', amount: '100', date: new Date(2021, 2,1)},
        {tile: 'Title3', amount: '100', date: new Date(2021, 2,1)},
    ];
  return (
    <div>
      <h2>Let's get started!</h2>
      <ExpenseItem></ExpenseItem>
      <ExpenseItem></ExpenseItem>
      <ExpenseItem></ExpenseItem>
    </div>
  );
}

export default App;
